    false,nt"url": null,nt"notes": "This annual narrative report for Kirwin
    National Wildlife Refuge summarizes refuge activities during the 2000 calendar year.
     The report begins with a summary of the years highlights and climatic conditions.
    Land acquisitionincluding fee title is also covered. The report includes a planning
    section which discusses research and investigations.  Refuge administration is outlined;
    information about personnel, youth programs, youth programs, other manpower programs,
    volunteer programs, funding, safety, and other is given.  Habitat management is
    also covered.  Subjects include general, croplands, grasslands, other habitat, grazing,
    fire management, pest control, and Partners for Wildlife.  The wildlife section
    of the report discusses wildlife diversity, endangered andor threatened species,
    waterfowl, marsh and water birds, shorebirds, gulls, terns and allied species, raptors,
    other migratory species, other resident wildlife, and fisheries resources.  The
    public uses of the refuge described in this report include general, outdoor classrooms
    students, interpretive exhibitsdemonstrations, other interpretive programs, hunting,
    fishing, camping, law enforcement and cooperating associations.  The equipment and
    facilities section of the report provides information about new construction, rehabilitation,
    major maintenance, equipment utilization and replacement, communication systems,
    and energy conservation.  Items of interest are provided at the end.",nt"license_title":
